#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Телефон',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Пользователи';


#
# TABLE STRUCTURE FOR: countries
#


CREATE TABLE `countries` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор страны',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название страны',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Справочник стран';




#
# TABLE STRUCTURE FOR: cities
#



CREATE TABLE `cities` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор города',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `country_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на страну проживания',
  PRIMARY KEY (`id`),
  KEY `cities_country_id_fk` (`country_id`),
  CONSTRAINT `cities_country_id_fk` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Справочник городов';




#
# TABLE STRUCTURE FOR: perposes
#


CREATE TABLE `perposes` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Ссылка на пользователя',
  `points` int(10) unsigned NOT NULL COMMENT 'Ежедневная цель в баллах кардиотренеровки',
  `steps` int(10) unsigned NOT NULL COMMENT 'Ежедневная цель в шагах',
  `time_to_go_to_bed` time DEFAULT NULL COMMENT 'Желаемое время отхода ко сну',
  `time_to_wake_up` time DEFAULT NULL COMMENT 'Желаемое время подъема',
  PRIMARY KEY (`user_id`),
  CONSTRAINT `perposes_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Ежедневные цели пользователя';



#
# TABLE STRUCTURE FOR: profiles
#

CREATE TABLE `profiles` (
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `gender` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Пол',
  `birthday` date DEFAULT NULL COMMENT 'Дата рождения',
  `city_id` int(10) unsigned DEFAULT NULL COMMENT ' ссылка на город проживания',
  `height` int(10) unsigned DEFAULT NULL COMMENT 'РОСТ В САНТИМЕТРАХ',
  `weight` float unsigned DEFAULT NULL COMMENT 'ВЕС В КГ',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`user_id`),
  KEY `profiles_city_id_fk` (`city_id`),
  CONSTRAINT `profiles_city_id_fk` FOREIGN KEY (`city_id`) REFERENCES `cities` (`id`),
  CONSTRAINT `profiles_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Профили';



#
# TABLE STRUCTURE FOR: types_of_trainings
#

DROP TABLE IF EXISTS `types_of_trainings`;

CREATE TABLE `types_of_trainings` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор типа тренировки',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название тренировки',
  `cardio_intencity` int(10) unsigned NOT NULL COMMENT 'Кардио интенсивность тренировки по умолчанию в час',
  `kkal_hour` int(10) unsigned NOT NULL COMMENT 'Количество сжигаемых каллорий в час',
  `steps_hour` int(10) unsigned NOT NULL COMMENT 'Количество шагов во время тренировки в час',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Справочник типов тренеровки';





#
# TABLE STRUCTURE FOR: trainings
#


CREATE TABLE `trainings` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор тренировки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `type_of_training_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на тип тренировки',
  `started_at` datetime DEFAULT current_timestamp() COMMENT 'Время начала тренировки',
  `finished_at` datetime DEFAULT current_timestamp() COMMENT 'Время окончания тренировки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время создания и обновления строки',
  `cardio_intencity` int(10) unsigned NOT NULL COMMENT 'Кардио интенсивность тренировки, которую задает пользователь',
  `kkal` int(10) unsigned NOT NULL COMMENT 'Количество сожженных каллорий, которые задает пользоваель',
  `steps` int(10) unsigned NOT NULL COMMENT 'Количество пройденных шагов, которые задает пользоваель',
  `comment` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Примечание к тренировке',
  PRIMARY KEY (`id`),
  KEY `trainings_user_id_fk` (`user_id`),
  KEY `trainings_type_of_training_idfk` (`type_of_training_id`),
  CONSTRAINT `trainings_type_of_training_idfk` FOREIGN KEY (`type_of_training_id`) REFERENCES `types_of_trainings` (`id`),
  CONSTRAINT `trainings_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Тренировки пользователей';



